import React, { Component } from 'react'

//components

class termCondition extends Component {
    render() {
        return (
            <div>
                <p>The content on this web site has been provided and/or reviewed by our practice. We have reviewed the information presented on this web site and find it to be in accordance with the standards of the health care profession in our jurisdiction. We strive to provide unbiased and accurate information related to our practice, eyecare services, and eyewear products. This information is not presented as a substitute for informed professional advice and does not substitute for consultation with an optometrist or any other health and/or medical professional.</p>
                <p>If you have any questions about your individual situation, please contact your eye health professional. Everyday Eyecare does not endorse any of the products or treatments described, mentioned or discussed in any of the web pages, services or database information accessible within this website. In view of the possibility of human error or advances in scientific knowledge, neither Everyday Eyecare, and/or any commercial or non-profit sponsors, staff nor any other party involved in providing web pages, services or database information accessible within this website warrant that the information contained therein is in every respect accurate or complete and they are not responsible nor liable for any errors or omissions that may be found in such information or for the results obtained from the use of such information.</p>
                <p></p>
            </div>
        )
    }
}

export default termCondition
